import{_ as e}from"./nuxt-link.ef4e9741.js";import{_ as o,a as n,b as v,c as l,d as _,e as r,f as m}from"./mail_red.8e95c2ae.js";import{a as x,o as p,e as b,f as a,b as s,w as d,h as f,p as u,i as g}from"./entry.d4251e4c.js";const h={},i=t=>(u("data-v-265432c5"),t=t(),g(),t),k={class:"index"},w={class:"index-vol"},y=i(()=>a("img",{class:"index-vol-img",src:l,alt:"fb"},null,-1)),I=i(()=>a("img",{class:"index-vol-img",src:_,alt:"fb"},null,-1)),S=i(()=>a("img",{class:"index-vol-img",src:r,alt:"fb"},null,-1)),B=i(()=>a("img",{class:"index-vol-img",src:m,alt:"fb"},null,-1)),N=f('<div id="acitivity" class="index-movie" data-v-265432c5><div class="index-movie-box" data-v-265432c5><div class="index-movie-inner" data-v-265432c5><div class="index-movie-head" data-v-265432c5>近期活動</div><img class="index-movie-img" src="'+o+'" alt="fb" data-v-265432c5><a href="https://ocam.fonticket.com" target="_blank" data-v-265432c5><div class="index-movie-btn" data-v-265432c5>報名連結</div></a></div></div></div><div id="about" class="index-about" data-v-265432c5><div class="index-about-head" data-v-265432c5>關於《 seaborn 》</div><div class="index-about-text" data-v-265432c5> 談起基隆，總離不開海、雨、港。即使近來有更多關於山的討論，仍舊伴隨著海港。<br data-v-265432c5><br data-v-265432c5> 這是一個如此狹小稠密、層層堆疊，交織出複雜氣味的城市，以至於有時不知該從何說起。但如果只能選一個面向與你訴說，我們想將海港生活刻劃得更深更廣一些，因為那是與城市脈動息息相關，卻如微光隱露的一面。<br data-v-265432c5><br data-v-265432c5> 基隆是因海而生的城市，最早起於和平島一帶的馬賽族原住民，以漁獵與貿易維生。而後大航海時代由西班牙開啟基隆在世界舞台的篇章，另有無數漢人懷抱夢想，跨越凶險的黑水溝到此闖蕩，再到日治時期、國民政府遷臺、基隆港躍升世界第七大貨櫃港…不同族群來去，各自為基隆留下大海的基因。加上時代推移，點點滴滴匯聚成為今日海港城市的獨特性格。<br data-v-265432c5><br data-v-265432c5> 但我們不想僅僅在陸地上談論海，而是打算航海。以這座海港城市作為起點與歸屬，航向世界、航向未知，以不怕犯難的冒險精神前行，這也是刊物取名《seaborn》的由來。 </div></div><div id="contact" class="index-contact" data-v-265432c5><div class="index-contact-title" data-v-265432c5>聯絡我們</div><div class="index-contact-des" data-v-265432c5><div class="index-contact-text" data-v-265432c5>地址：基隆市仁愛區港西街4號</div><div class="index-contact-text" data-v-265432c5>電話：(02) 2421-5681</div><div class="index-contact-text" data-v-265432c5>營業時間：週二至週日上午9時至下午5時</div><div class="index-contact-text" data-v-265432c5>休館時間：每週一、除夕、春節初 一</div></div><div class="index-contact-social" data-v-265432c5><a href="https://www.facebook.com/keelung1915" class="index-contact-social-href" target="_blank" data-v-265432c5><img class="index-contact-social-icon" src="'+n+'" alt="logo" data-v-265432c5></a><a href="mailto:museum@yangming.com?subject=陽明網站事宜&amp;body=你好，" class="index-contact-social-href" target="_blank" data-v-265432c5><img class="index-contact-social-icon" src="'+v+'" alt="logo" data-v-265432c5></a></div></div>',3);function V(t,j){const c=e;return p(),b("div",k,[a("div",w,[s(c,{to:"/vol-star"},{default:d(()=>[y]),_:1}),s(c,{to:"/vol-flavor"},{default:d(()=>[I]),_:1}),s(c,{to:"/"},{default:d(()=>[S]),_:1}),s(c,{to:"/"},{default:d(()=>[B]),_:1})]),N])}const z=x(h,[["render",V],["__scopeId","data-v-265432c5"]]);export{z as default};
